var title_f7_56_8076="Ingredient label terms for egg";
var content_f7_56_8076=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F53488&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F53488&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    How to read an ingredient label for an egg-free diet",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Avoid foods that contain eggs or any of these ingredients:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Albumin (also spelled albumen)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Egg (dried, powdered, solids, white, yolk)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Eggnog",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lysozyme",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Mayonnaise",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Meringue (meringue powder)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ovalbumin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Surimi",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Egg is sometimes found in the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Baked goods",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Puddings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ice cream",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Smoothies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soups",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sauces",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Egg substitutes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lecithin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Macaroni",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Marzipan",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Marshmallows",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nougat",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pasta",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Keep the following in mind:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Individuals with egg allergy should also avoid eggs from duck, turkey, goose, quail, etc., as these are known to be cross-reactive with chicken egg.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    All FDA-regulated manufactured food products that contain egg as an ingredient are required by US law to list the word \"egg\" on the product label.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; 2010 The Food Allergy &amp; Anaphylaxis Network. Used with permission.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f7_56_8076=[""].join("\n");
