"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Selected interacting drugs and drug classes",
"       </td>",
"       <td class=\"subtitle1\">",
"        Effect",
"       </td>",
"       <td class=\"subtitle1\">",
"        Management suggestions",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommendations found in licensed product information*",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Combined strong inhibitors of CYP3A4 and P-gp",
"        </strong>",
"        (eg, boceprevir",
"        <sup>",
"         &bull;",
"        </sup>",
"        , clarithromycin, cobicistat containing coformulations, conivaptan",
"        <sup>",
"         &bull;",
"        </sup>",
"        , delavirdine",
"        <sup>",
"         &bull;",
"        </sup>",
"        ,",
"        <strong>",
"         all",
"        </strong>",
"        HIV protease inhibitors",
"        <sup>",
"         &Delta;",
"        </sup>",
"        [eg, ritonavir], imatinib",
"        <sup>",
"         &bull;",
"        </sup>",
"        , itraconazole, ketoconazole, nefazodone",
"        <sup>",
"         &bull;",
"        </sup>",
"        , posaconazole",
"        <sup>",
"         &bull;",
"        </sup>",
"        , telaprevir, telithromycin",
"        <sup>",
"         &bull;",
"        </sup>",
"        , voriconazole",
"        <sup>",
"         &bull;",
"        </sup>",
"        )",
"       </td>",
"       <td>",
"        Increased apixaban concentration (significant effect)",
"       </td>",
"       <td>",
"        Avoid co-administration of strong inhibitors of both CYP3A4 and P-gp. Apixaban dose reduction is an option, according to US licensing information, for patients with AF requiring co-administration of strong dual inhibitors, provided not more than one of following factors: age &ge;80 years, weight &le;60 kg, or serum creatinine &ge;1.5 mg/dL. This dose adjustment has not been tested in clinical trials. The efficacy of routine coagulation testing to evaluate the degree of anticoagulation with apixaban is limited and is discussed in the text.",
"       </td>",
"       <td>",
"        <strong>",
"         US:",
"        </strong>",
"        Avoid coadministration or reduce apixaban dose to 2.5 mg twice daily for nonvalvular AF. In patients already taking 2.5 mg twice daily due to any two of the following: SCr &gt;1.5 mg/dL, age &ge;80 years, or weight &le;60 kg, avoid coadministration.",
"        <br/>",
"        <strong>",
"         CAN:",
"        </strong>",
"        Coadministration with strong inhibitors of both CYP3A4 and P-gp is contraindicated.",
"        <br/>",
"        <strong>",
"         EMA, UK:",
"        </strong>",
"        Coadministration with strong inhibitors of both CYP3A4 and P-gp is not recommended.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Combined inhibitors of P-gp and/or moderate inhibitors of CYP3A4",
"        </strong>",
"        (eg, amiodarone, azithromycin, chloramphenicol, cimetidine, erythromycin, cyclosporine, diltiazem, dronedarone, felodipine, fluconazole",
"        <sup>",
"         &bull;",
"        </sup>",
"        , grapefruit and grapefruit juice",
"        <sup>",
"         &loz;",
"        </sup>",
"        , lapatinib, lomitapide, mifepristone, naproxen",
"        <sup>",
"         &bull;",
"        </sup>",
"        , nicardipine, quinidine, ranolazine, tamoxifen, verapamil)",
"       </td>",
"       <td>",
"        Increased apixaban concentration (moderate effect in patients with normal renal function; potentially significant effect in patients having severe renal insufficiency)",
"       </td>",
"       <td>",
"        Use with caution; if co-administration is necessary, no specific dose adjustment is recommended. Avoid co-administration in patients with renal insufficiency (CrCl 15 to 50 mL/minute), age &ge;80 years, or low body weight &lt;60 kg.",
"       </td>",
"       <td>",
"        <strong>",
"         US, CAN, EMA, UK:",
"        </strong>",
"        Moderate inhibitors of CYP3A4 and/or P-gp resulted in a &le;1.5-fold increase in apixaban concentrations. No dose adjustment required.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Combined strong inducers of P-gp and CYP3A4",
"        </strong>",
"        (eg, carbamazepine, dexamethasone, rifampin",
"        <sup>",
"         &sect;",
"        </sup>",
"        )",
"        <br/>",
"        <strong>",
"         Inducers of P-gp",
"        </strong>",
"        (eg, doxorubicin, nefazodone, prazosin, St. John's wort, tipranavir, trazodone, vinblastine)",
"        <br/>",
"        <strong>",
"         Strong inducers of CYP3A4",
"        </strong>",
"        (eg, aminoglutethimide, barbiturates, bosentan, efavirenz, etravirine, fosphenytoin, nafcillin, nevirapine, oxcarbazepine, pentobarbital, phenobarbital, phenytoin, primidone, rifabutin, rifapentine)",
"       </td>",
"       <td>",
"        Decreased apixaban concentration (significant effect)",
"       </td>",
"       <td>",
"        Avoid concurrent use with agents known to strongly induce CYP3A4 and/or P-gp. Effect on apixaban concentration may persist for several weeks following discontinuation of a strong inducer of P-gp and/or 3A4.",
"       </td>",
"       <td>",
"        <strong>",
"         US:",
"        </strong>",
"        Avoid co-administration with strong inducers of CYP3A4 and P-gp.",
"        <br/>",
"        <strong>",
"         CAN:",
"        </strong>",
"        Co-administration of strong inducers of CYP3A4 and/or P-gp should generally be avoided. Increased adverse effects (thrombotic and major bleeding) have been noted.",
"        <br/>",
"        <strong>",
"         EMA, UK:",
"        </strong>",
"        Strong inducers of both CYP3A4 and P-gp led to approximately 50 percent decrease in apixaban concentrations. No dose adjustment required. Use caution.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Interaction data and recommendations refer to systemic drug forms. Specific drug interactions and management suggestions may be determined by using Lexi-Interact, the drug interactions program included with UpToDate.",
"    <div class=\"footnotes\">",
"     AF: atrial fibrillation; CYP3A4: cytochrome P-450 3A4; P-gp: P-glycoprotein efflux transporters; VTE: venous thromboembolism; CrCl: creatinine clearance; US: United States Prescribing Information; CAN: Canadian Product Monograph; EMA: European Medicines Agency Summary of Product Characteristics; UK: United Kingdom Summary of Product Characteristics.",
"     <br>",
"      *",
"      <strong>",
"       Drug interactions, management recommendations, and contraindicated drug combinations listed in licensed product information vary by country. Consult official product information for details before using this agent.",
"      </strong>",
"      <br>",
"       <font class=\"bullet\">",
"        &bull;",
"       </font>",
"       Limited or conflicting data concerning relevance of P-gp inhibition.",
"       <br>",
"        &Delta; Atazanavir, darunavir, fosamprenavir, indinavir, lopinavir, nelfinavir, ritonavir, saquinavir, and tipranavir.",
"        <br>",
"         <font class=\"lozenge\">",
"          &loz;",
"         </font>",
"         Avoidance of grapefruit and grapefruit juice in large quantities advised due to lack of predictability of its effect.",
"         <br>",
"          &sect; Rifampicin is international nonproprietary (generic) name.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
